import React, { Component } from 'react';
import { Container, Row, Col, Card, CardBody, CardHeader, Button } from "reactstrap";
import { Link } from "react-router-dom";

//Import Countdown
import Countdown from "react-countdown";

class Section extends Component {
    constructor() {
        super();
        this.renderer.bind(this)
    }

    renderer = ({ days, hours, minutes, seconds, completed }) => {
        if (completed) {
            // Render a completed state
            return <span>You are good to go!</span>;
        } else {
            // Render a countdown
             return <>
                    <div className="coming-box">{days}<span>Days</span></div>
                    <div className="coming-box">{hours}<span>Hours</span></div>
                    <div className="coming-box">{minutes}<span>Minutes</span></div>
                    <div className="coming-box">{seconds}<span>Seconds</span></div>
                    </>
        }
    }

    render() {
        return (
            <React.Fragment>
                <section className="section hero-section bg-ico-hero" id="home">
                    <div className="bg-overlay bg-primary"></div>
                    <Container>
                        <Row className="align-items-center">
                            <Col lg="5">
                                <div className="text-white-50">
                                    <h1 className="text-white font-weight-semibold mb-3 hero-title">Skote - Ico Landing for a cryptocurrency business</h1>
                                    <p className="font-size-14">It will be as simple as occidental in fact to an English person, it will seem like simplified as a skeptical Cambridge</p>
                                    
                                    <div className="button-items mt-4">
                                        <Link to="#" className="btn btn-success mr-1">Get Whitepaper</Link>
                                        <Link to="#" className="btn btn-light">How it work</Link>
                                    </div>
                                </div>
                            </Col>
                            <Col lg="5" md="8" sm="10" className="ml-lg-auto">
                                <Card className="overflow-hidden mb-0 mt-5 mt-lg-0">
                                    <CardHeader className="text-center">
                                        <h5 className="mb-0">ICO Countdown time</h5>
                                    </CardHeader>
                                    <CardBody>
                                        <div className="text-center">
                                            
                                            <h5>Time left to Ico :</h5>
                                            <div className="mt-4">
                                                <div className="counter-number ico-countdown">
                                                <Countdown
                                                    date="2020/12/31"
                                                    renderer={this.renderer}
                                                />
                                                </div>
                                            </div>

                                            <div className="mt-4">
                                                <Button type="button" color="success" className="w-md">Get Token</Button>
                                            </div>

                                            <div className="mt-5">
                                                <h4 className="font-weight-semibold">1 ETH = 2235 SKT</h4>
                                                <div className="clearfix mt-4">
                                                    <h5 className="float-right font-size-14">5234.43</h5>
                                                </div>
                                                <div className="progress p-1 progress-xl softcap-progress">
                                                    <div className="progress-bar bg-info" role="progressbar" style={{width: "15%"}} aria-valuenow="15" aria-valuemin="0" aria-valuemax="100">
                                                        <div className="progress-label">15 %</div>
                                                    </div>
                                                    <div className="progress-bar progress-bar-striped progress-bar-animated" role="progressbar" style={{width: "30%"}} aria-valuenow="30" aria-valuemin="0" aria-valuemax="100">
                                                        <div className="progress-label">30 %</div>
                                                    </div>
                                                </div>
                                            </div>
                                        </div>
                                    </CardBody>
                                </Card>
                            </Col>
                        </Row>
                        
                    </Container>
                    
                </section> 
            </React.Fragment>
        );
    }
}

export default Section;
